import React from 'react';
import './App.css';
import HomeIndex from './HomeIndex';
import About from './About';

function App() {
  return (
    <div>
      <Router>
        <Route exact path="/" component={HomeIndex}/>
        <Route exact path="/" component={About}/>
      </Router>
    </div>
  );
}

export default App;
